  var day=date.toLocaleString('en-us', {weekday:'long'})
  return day;
};
const WeeklyForecast=({ data }) =>{

return (
  <List sx={style} component="nav" aria-label="mailbox folders">
      {data.map((item,idx)=>
      { 
        return(
         <ListItem>
        <Typography
        variant="p"
        component="p"
        sx={itemstyle}>
          <Grid container spacing={{ xs: 2, md: 2}} columns={{ xs: 4, sm: 8, md: 12 }}>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
           {dayfunc(item.date)}
          </Grid>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
          <div className="flex-container">
      <div className="item">  <ThermostatIcon
        sx={imagefont}
      /> </div>
      <div className="item"> { item.temp } Â°c</div>
    </div>
          </Grid>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
        <div className="flex-container">
      <div className="item">  <AirIcon
        sx={imagefont}
      /> </div>
      <div className="item"> {item.wind} M/S</div>
    </div>
          </Grid>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
            {datefunc(item.date)}
          </Grid>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
          <div className="flex-container">
      <div className="item">  <FilterDramaIcon
        sx={imagefont}
      /> </div>
      <div className="item"> {item.clouds} %</div>
    </div>
          </Grid>
          <Grid item xs={2} sm={4} md={4} sx={subitemstyle}>
          <div className="flex-container">
      <div className="item">  <SvgIcon
          component={HumidityIcon}
          inheritViewBox
          sx={imagefont}
        /> </div>
      <div className="item"> {item.humidity} M/S</div>
    </div>
          </Grid>

      </Grid>
      </Typography>
      </ListItem>
     ); })}
  </List>
)
};

